{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/kenjira/visualizing-covid-19-case-study-project?scriptVersionId=134154737\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"b4c05288","metadata":{"dc":{"key":"4"},"deletable":false,"papermill":{"duration":0.004817,"end_time":"2023-06-19T17:38:50.198235","exception":false,"start_time":"2023-06-19T17:38:50.193418","status":"completed"},"run_control":{"frozen":true},"tags":["context"]},"source":["## 1. From epidemic to pandemic\n","<p><img style=\"float: left; margin:5px 20px 5px 1px; width:40%\" src=\"https://www.nps.gov/aboutus/news/images/CDC-coronavirus-image-23311-for-web.jpg?maxwidth=650&autorotate=false\"></p>\n","<p>In December 2019, COVID-19 coronavirus was first identified in the Wuhan region of China. By March 11, 2020, the World Health Organization (WHO) categorized the COVID-19 outbreak as a pandemic. A lot has happened in the months in between with major outbreaks in Iran, South Korea, and Italy. </p>\n","<p>We know that COVID-19 spreads through respiratory droplets, such as through coughing, sneezing, or speaking. But, how quickly did the virus spread across the globe? And, can we see any effect from country-wide policies, like shutdowns and quarantines? </p>\n","<p>Fortunately, organizations around the world have been collecting data so that governments can monitor and learn from this pandemic. Notably, the Johns Hopkins University Center for Systems Science and Engineering created a <a href=\"https://github.com/RamiKrispin/coronavirus\">publicly available data repository</a> to consolidate this data from sources like the WHO, the Centers for Disease Control and Prevention (CDC), and the Ministry of Health from multiple countries.</p>\n","<p>In this notebook, you will visualize COVID-19 data from the first several weeks of the outbreak to see at what point this virus became a global pandemic.</p>\n","<p><em>Please note that information and data regarding COVID-19 is frequently being updated. The data used in this project was pulled on March 17, 2020, and should not be considered to be the most up to date data available.</em></p>"]},{"cell_type":"code","execution_count":1,"id":"47fe860f","metadata":{"dc":{"key":"4"},"execution":{"iopub.execute_input":"2023-06-19T17:38:50.209223Z","iopub.status.busy":"2023-06-19T17:38:50.207625Z","iopub.status.idle":"2023-06-19T17:38:50.953125Z","shell.execute_reply":"2023-06-19T17:38:50.951772Z"},"papermill":{"duration":0.752815,"end_time":"2023-06-19T17:38:50.954992","exception":false,"start_time":"2023-06-19T17:38:50.202177","status":"completed"},"tags":["sample_code"]},"outputs":[{"name":"stderr","output_type":"stream","text":["\n","Attaching package: ‘dplyr’\n","\n","\n","The following objects are masked from ‘package:stats’:\n","\n","    filter, lag\n","\n","\n","The following objects are masked from ‘package:base’:\n","\n","    intersect, setdiff, setequal, union\n","\n","\n","\u001b[1mRows: \u001b[22m\u001b[34m56\u001b[39m \u001b[1mColumns: \u001b[22m\u001b[34m2\u001b[39m\n","\u001b[36m──\u001b[39m \u001b[1mColumn specification\u001b[22m \u001b[36m────────────────────────────────────────────────────────\u001b[39m\n","\u001b[1mDelimiter:\u001b[22m \",\"\n","\u001b[32mdbl\u001b[39m  (1): cum_cases\n","\u001b[34mdate\u001b[39m (1): date\n","\n","\u001b[36mℹ\u001b[39m Use `spec()` to retrieve the full column specification for this data.\n","\u001b[36mℹ\u001b[39m Specify the column types or set `show_col_types = FALSE` to quiet this message.\n"]},{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A spec_tbl_df: 56 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>date</th><th scope=col>cum_cases</th></tr>\n","\t<tr><th scope=col>&lt;date&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>2020-01-22</td><td>   555</td