 outbreak: around March 14, the total number of cases outside China overtook the cases inside China. This was days after the WHO declared a pandemic.</p>\n","<p>There were a couple of other landmark events that happened during the outbreak. For example, the huge jump in the China line on February 13, 2020 wasn't just a bad day regarding the outbreak; China changed the way it reported figures on that day (CT scans were accepted as evidence for COVID-19, rather than only lab tests).</p>\n","<p>By annotating events like this, we can better interpret changes in the plot.</p>"]},{"cell_type":"code","execution_count":4,"id":"32272397","metadata":{"dc":{"key":"26"},"execution":{"iopub.execute_input":"2023-06-19T17:38:51.798139Z","iopub.status.busy":"2023-06-19T17:38:51.797105Z","iopub.status.idle":"2023-06-19T17:38:52.04646Z","shell.execute_reply":"2023-06-19T17:38:52.045289Z"},"papermill":{"duration":0.258738,"end_time":"2023-06-19T17:38:52.048738","exception":false,"start_time":"2023-06-19T17:38:51.79","status":"completed"},"tags":["sample_code"]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3zU9BsH8CfJzfbao3szWqCULSoIMgVUirKHoKKIqIjrJw4cKIjiRgREFFSG\nAlIBQYooKA6GKKKACpQ9S4FSSsfNJL8/Uo5S2uuVXptxn/cfvO5yae7J3febe/h+kyeMKIoE\nAAAAAOrHyh0AAAAAAPgHEjsAAAAAjUBiBwAAAKARSOwAAAAANAKJHQAAAIBGILEDAAAA0Agk\ndgAAAAAagcQOAAAAQCN0cgegOHl5eXKH4E86nS4oKOjChQtyByIPnU4XHBxMRAUFBYIgyB2O\nDBiGCQ0NDfDdJ6Li4mKXyyV3OEoRHBzsdrsdDofcgSiF2Ww2GAxut7uoqEjuWORhMBj0en0g\n777ZbBZFUUW/lWFhYRW9hMSuLEEQtHQ3DpZlWZbleV7uQOQh7T4RCYIQmB8CwzAsywb47hOR\nKIqB+QmUi2EYfCBlsCzLMEzAfiaiKAb47rMsq5lOgcQOlCgzM/PAgQMpKSm9e/eWOxaQARoA\ngFahd9c0nGMHSpSRkTF58uSMjAy5AwF5oAEAaBV6d01DYgcAAACgEbU9FTtvzD2mV2bfEWWW\nnoruvBVzPvp2845cOxuX1KjP3Q/dck3sxXWFn5bM+uaX7ccKuLTm7e59bGQDM3dVy72/BAAA\nAKARtZnYifs3frbi5PnBpS5N+H7KU5//G3LPA481TQje+cPiWRPH2mfO75tkIaKDy15878sj\nd4995L4w9+qPPnjhSfcXHz7EVH25l02BYqWnp6ekpKSmpsodCMgDDQBAq9C7a1otJXanfp32\n4sebTudfdnU97zg2+8+z