"tags":["context"]},"source":["## 9. Plotting hardest hit countries as of Mid-March 2020\n","<p>Even though the outbreak was first identified in China, there is only one country from East Asia (South Korea) in the above table. Four of the listed countries (France, Germany, Italy, and Spain) are in Europe and share borders. To get more context, we can plot these countries' confirmed cases over time.</p>\n","<p>Finally, congratulations on getting to the last step! If you would like to continue making visualizations or find the hardest hit countries as of today, you can do your own analyses with the latest data available <a href=\"https://github.com/RamiKrispin/coronavirus\">here</a>. </p>"]},{"cell_type":"code","execution_count":9,"id":"5f72a225","metadata":{"dc":{"key":"61"},"execution":{"iopub.execute_input":"2023-06-19T17:38:53.918367Z","iopub.status.busy":"2023-06-19T17:38:53.917188Z","iopub.status.idle":"2023-06-19T17:38:54.400568Z","shell.execute_reply":"2023-06-19T17:38:54.399243Z"},"papermill":{"duration":0.495991,"end_time":"2023-06-19T17:38:54.402769","exception":false,"start_time":"2023-06-19T17:38:53.906778","status":"completed"},"tags":["sample_code"]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1mRows: \u001b[22m\u001b[34m2030\u001b[39m \u001b[1mColumns: \u001b[22m\u001b[34m3\u001b[39m\n","\u001b[36m──\u001b[39m \u001b[1mColumn specification\u001b[22m \u001b[36m────────────────────────────────────────────────────────\u001b[39m\n","\u001b[1mDelimiter:\u001b[22m \",\"\n","\u001b[31mchr\u001b[39m  (1): country\n","\u001b[32mdbl\u001b[39m  (1): cum_cases\n","\u001b[34mdate\u001b[39m (1): date\n","\n","\u001b[36mℹ\u001b[39m Use `spec()` to retrieve the full column specification for this data.\n","\u001b[36mℹ\u001b[39m Specify the column types or set `show_col_types = FALSE` to quiet this message.\n"]},{"name":"stdout","output_type":"stream","text":["Rows: 2,030\n","Columns: 3\n","$ country   \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m 